SET NAMES utf8;
SET FOREIGN_KEY_CHECKS = 0;

BEGIN;
CREATE DATABASE IF NOT EXISTS `mysmarthome`; 
COMMIT;

USE `mysmarthome`;



drop table if exists Utente;
create table Utente (
	CodiceFiscale VARCHAR(50),
	DataNascita DATE,
	Nome VARCHAR(50),
	Cognome VARCHAR(50),
	Telefono VARCHAR(50),
	NomeUtente VARCHAR(50),
	primary key(CodiceFiscale)
);

drop table if exists Account;
create table Account (
	NomeUtente VARCHAR(10),
	Data DATE,
	Password VARCHAR(50),
	CodiceFiscale VARCHAR(6),
	primary key(NomeUtente)
);

drop table if exists Dispositivi;
create table Dispositivi (
	Codice INT,
	Nome VARCHAR(23),
	Stanza VARCHAR(4),
	primary key(Codice)
);



drop table if exists Stanze;
create table Stanze (
	CodiceStanza VARCHAR(4),
	Larghezza INT,
	Altezza INT,
	Lunghezza INT,
	Nome VARCHAR(11),
	EfficienzaEnergetica INT,
	primary key(CodiceStanza)
);
-- insert into Stanze (CodiceStanza, Larghezza, Altezza, Lunghezza, Nome, EfficienzaEnergetica) values (1001, 10, 3, 5, 'Bagno', 6);


drop table if exists PuntiDiAccesso;
create table PuntiDiAccesso (
	CodicePuntoDiAccesso INT,
	CodiceStanza VARCHAR(4),
	Categoria VARCHAR(14),
	PuntoDiAffaccio VARCHAR(4),
	PuntoCardinale VARCHAR(2),
	primary key(`CodicePuntoDiAccesso`,`CodiceStanza`)
);

drop table if exists Programmi;
create table Programmi (
        NomeProgramma VARCHAR(10),
        Dispositivo INT,
        Temperatura INT,
        Potenza INT,
        Umidita INT,
        Colore VARCHAR(50),
        ConsumoMedio INT,
        Durata INT,
        primary key (NomeProgramma, Dispositivo)
);
-- insert into Programmi (NomeProgramma, Dispositivo, Temperatura, Potenza, Umidita, Colore, ConsumoMedio, Durata) values ('Notte', 40, 62, 12, 96, '#1359fa',897,6);
