drop table if exists Documento;
create table Documento (
	CodiceFiscale VARCHAR(6),
	Tipo VARCHAR(16),
	DataScadenza DATE,
	Ente VARCHAR(14),
	Numero VARCHAR(50),
	primary key(CodiceFiscale)
);


drop table if exists InfoRecupero;
create table InfoRecupero (
	NomeUtente VARCHAR(10),
	Domanda VARCHAR(36),
	Risposta VARCHAR(8),
	primary key(NomeUtente)
);

drop table if exists Suggerimenti;
create table Suggerimenti (
	NomeUtente VARCHAR(10),
	Orario TIMESTAMP,
	Accettato VARCHAR(50),
	Suggerimento VARCHAR(50),
	primary key(NomeUtente,Orario)
);







drop table if exists EnergiaProdotta;
create table EnergiaProdotta (
	Fonte VARCHAR(6),
	Orario VARCHAR(50),
	Quantita INT,
	Data DATE,
	FasciaOraria VARCHAR(50),
	primary key(`Fonte`,`Orario`)
);
