drop table if exists SmartPlug;
create table SmartPlug (
	Codice INT,
	DispositivoAssociato VARCHAR(20),
    primary key(Codice)
);



drop table if exists ElementoCondizionamento;
create table ElementoCondizionamento (
	Codice INT,
	Umidita VARCHAR(10),
	Temperatura VARCHAR(10),
	Potenza VARCHAR(10),
	ConsumoMassimo VARCHAR(10),
	primary key (Codice)
);




drop table if exists ElementoIlluminazione;
create table ElementoIlluminazione (
	Codice INT,
	ConsumoMassimo INT,
	Temperatura VARCHAR(5),
	Colore VARCHAR(27),
	Intensita VARCHAR(5),
	Tipo VARCHAR(13),
	primary key(Codice)
);


drop table if exists Modalita;
create table Modalita (
	Nome VARCHAR(50),
	Stanza VARCHAR(250),
	primary key(Nome)
);

drop table if exists Associazione;
create table Associazione (
	NomeProgramma VARCHAR(10),
	Dispositivo INT,
	primary key(NomeProgramma, Dispositivo)
);


drop table if exists Registri;
create table Registri (
	NomeImpostazione VARCHAR(18),
	Dispositivo INT,
	DataInizio TIMESTAMP,
	DataFine TIMESTAMP,
	DataInserimento TIMESTAMP,
	Utente VARCHAR(10),
	ConsumoMedio INT,
	primary key(NomeImpostazione, Dispositivo, DataInizio, DataFine)
);


drop table if exists Luci;
create table Luci (
	NomeImpostazione VARCHAR(18),
	Dispositivo INT,
	DataInizio TIMESTAMP,
	DataFine TIMESTAMP,
	Intensita INT,
	Colore VARCHAR(50),
	Temperatura INT,
	primary key(NomeImpostazione, Dispositivo, DataInizio, DataFine)
);


drop table if exists DispositivoGenerico;
create table DispositivoGenerico (
	NomeImpostazione VARCHAR(18),
	Dispositivo INT,
	DataInizio TIMESTAMP,
	DataFine TIMESTAMP,
	Status VARCHAR(50),
	primary key(NomeImpostazione,Dispositivo,DataInizio,DataFine)
);


drop table if exists Condizionamento;
create table Condizionamento (
	NomeImpostazione VARCHAR(18),
	Dispositivo INT,
	DataInizio TIMESTAMP,
	DataFine TIMESTAMP,
	TemperaturaIniziale INT,
	TemperaturaFinale INT,
	Umidita INT,
	Potenza INT,
	primary key(NomeImpostazione,Dispositivo,DataInizio,DataFine)
);


drop table if exists Accessi;
create table Accessi (
	Persona VARCHAR(10),
	OraAccesso TIMESTAMP,
	Stanza VARCHAR(4),
	OraUscita TIMESTAMP,
	Foto VARCHAR(50),
	primary key (Persona, OraAccesso, Stanza)
);

drop table if exists Serramenti;
create table Serramenti (
	PuntoDiAccesso INT,
	InizioImpostazione DATE,
	FineImpostazione DATE,
	Stato VARCHAR(50),
	Tipo VARCHAR(13),
	primary key (PuntoDiaccesso)
);


drop table if exists EnergiaConsumata;
create table EnergiaConsumata (
	Dispositivo INT,
	OraAccensione DATE,
	OraSpegnimento DATE,
	Consumo INT,
	FasciaOraria VARCHAR(50),
	NomeImpostazione VARCHAR(18),
	Utente VARCHAR(10),
    primary key (`Dispositivo`, `OraAccensione`, `OraSpegnimento`)
);








drop table if exists ArchivioEnergia;
create table ArchivioEnergia (
	Data DATE,
	FasciaOraria VARCHAR(10),
	EnergiaEolica INT,
	EnergiaSolare INT,
	EnergiaConsumata INT,
    primary key(`Data`, `FasciaOraria`)
);

-- Vincoli di integrità generici

-- controlla il primo vincolo
drop trigger if exists CheckUtente;
delimiter $$
create trigger CheckUtente
before insert on account
for each row
begin
	if not exists (select 1 from Utente where NomeUtente = new.NomeUtente) then
		signal sqlstate '45000'
        set message_text = "Utente non presente";
    end if;
end $$
delimiter ;


-- controlla il quarto vincolo
drop trigger if exists CheckProgramma;
delimiter $$
create trigger CheckProgramma
before insert on registri
for each row
begin
	if not exists (select 1 from programmi where Dispositivo = new.Dispositivo and new.NomeImpostazione = NomeProgramma) then
		signal sqlstate '45000'
        set message_text = "Programma non presente";
    end if;
end $$
delimiter ;